import React, { useState } from 'react';
import Square from './Square';
import 'board'

function Board() {
    const [squareval,setsquareval] = useState(Array(9).fill(null));
  return (
    <>
      <div className='full-view'>
          <div className='board'>
              <Square value={squareval[0]}/>
              <Square value={squareval[1]}/>
              <Square value={squareval[2]}/>

              <Square value={squareval[3]}/>
              <Square value={squareval[4]}/>
              <Square value={squareval[5]}/>

              <Square value={squareval[6]}/>
              <Square value={squareval[7]}/>
              <Square value={squareval[8]}/>
          </div>
          <div className='navigation'>

          </div>  
      </div> 
    </>
  )
}

export default Board;
